import { Link, Outlet } from "react-router-dom";

const BookLayoutAsFC : React.FC = () =>{

    return(

    <div>

        <ul>
            <li><Link to="/books/1"> Books 1</Link></li>
            <li><Link to="/books/2"> Books 2</Link></li>
            <li><Link to="/books/3"> Books 3</Link></li>
            <li><Link to="/books/newbook"> New Book</Link></li>
        </ul>

        <Outlet />
    </div>)
}

export default BookLayoutAsFC;
